@-moz-document url-prefix("https://online.mbank.pl/pl") {
.lifting {
    background-color: black !important;
    color: white !important;
}
.rtm-box .text{
    color:black;
}
aside section h3 {
    color: white;
}
body.lifting #header #user-profile #accounts-selector .open-company-account .button, body.lifting #header #user-profile #accounts-selector .open-individual-account .button
{
    color: #cc2141;
}
body.lifting #header #user-profile #accounts-selector .open-company-account:hover .button, body.lifting #header #user-profile #accounts-selector .open-individual-account:hover .button
{
    color: white;
}
.btn-gray-gradient-muted{
    color: #cc2141;
}
.btn-gray-gradient-muted:hover{
    color: white;
}
body.lifting #main-nav ul.second-level li a:hover{
    color: #cc2141;
}
body.lifting #main-nav ul.second-level li a {
    color: white;
}
body.lifting #main-nav ul.second-level li.active a {
    color: #cc2141;
}
#main-nav ul.first-level>li a{
    color: white;
}
#main-nav ul.first-level>li.active a{
    color: #cc2141;
}
body.lifting #desktop-page .history-region section.operations .operations-recent-list .operation-row {
    border-top: 1px solid white;
    border-radius: 0;
    background: black;
    color: white;
}
body.lifting #desktop-page .history-region section.operations .operations-recent-list .operation-row:last-child {
    border-bottom: 1px solid white;
}

#desktop-app-view .money-bar .money-bar-header {
    color: white;
}

.rtm-commercial .rtm-template-998{
	background: black;
    color: white;   
    border-color:blue;
}

body.lifting .rtm-commercial .rtm-template-998:hover [class*="close"]{
    background: white;
}
section.applications .applications-list li[class*="row"] {
       border-radius: 3px;
    margin-bottom: 4px;
    box-shadow: 0 0 0 0 rgba(255,255,255,0.22), 0 0 1px 0 rgba(255,255,255,0.92);
    border-bottom: 0;
}
.application-indicators>li .label, .application-indicators>li .value, .application-indicators>li .additional-info{
    color:#cc2141;
}
.application-history .history-events .item-row {
    background-color: black;
}
#mpublic-page-content nav ul li a{
    color:#cc2141;
}
#mpublic-page-content div.pz .pz-summary{
    color: white;   
}
#mpublic-page-content div.pz .pz-status-description{
    color: white;   
}
body.lifting .rtm-commercial .rtm-template-998 {
    border-radius: 3px;
    margin-bottom: 4px;
    box-shadow: 0 0 0 0 rgba(255,255,255,0.22), 0 0 1px 0 rgba(255,255,255,0.92);
    border-bottom: 0;
}
.rtm-commercial .rtm-template-998 .text a{
    color: white;   
}
.rtm-commercial .rtm-template-998:hover .text a{
    color: black;   
}
body.lifting #cyclic-dashboard .transfers-types-list .transfer-type-row[class*="transfer"]>a>.text{
    border-radius: 3px;
    box-shadow: 0 1px 2px 0 rgba(255,255,255,0.22), 0 0 1px 0 rgba(255,255,255,0.92);
    background-color: black;
    background-image: none;
    
}
body.lifting #transfer-app-root .transfers-types-list .transfer-type-row>a[id*="trans"] {
    border-radius: 3px;
    box-shadow: 0 1px 2px 0 rgba(255,255,255,0.22), 0 0 1px 0 rgba(255,255,255,0.92);
    background: black;
    color:#cc2141;
}

body.lifting [class^="receivers-list"] [class^="receiver-details"] li.receiver-name {
    color:#cc2141;
}
body.lifting #content [class^="receivers-list"] .receiver-row{
    border-radius: 3px;
    box-shadow: 0 1px 2px 0 rgba(255,255,255,0.22), 0 0 1px 0 rgba(255,255,255,0.92);
    background: black;
    color:white;
}
body.lifting [class^="receivers-list"] [class^="receiver-details"] [class^="receiver-name"]{
    color:white;
}
#content .section-header .section-nav ul>li a {
    color: white;
}
.content-list-row-header{
    color: white;
}
.content-list-row-header.hover{
    color: black;
}
body.lifting #history-filters-form label {
    background: none !important;
    background-color: black !important;
    color: white !important;
}
body.lifting #history-filters-form .filter span.checkbox-area{
    background: none !important;
    background-color: black !important;
    color: white !important;
}
.bar-list .bar-list-row .bar-list-row-header-container{
    color: white;   
}
.bar-list .bar-list-row .bar-list-row-header-container:hover{
    color: black;   
}
body.lifting .summary tr td{
    color: white !important;
}
#history-filters #base-history-filters .filter label{
    background-color: black !important;
    color: white !important;
}

#address-books .contact-details .record-details h3 {
    color: white !important;
}
#address-books .contact-details .record-details .lists li {
    color: white !important;
}

#address-books .contact-details .record-details .lists li a {
    color: white !important;
}
body.lifting #payments-planned-app-view .form-resend-summary .btn-gray-gradient:hover {
    background: black;
}

body.lifting #payments-planned-app-view section.operations div .operations-list .operation-row.active,body.lifting #payments-planned-app-view section.proposals div .operations-list .operation-row.active {
    background: black;
}

section.operations div .operations-list li[class*="row"], section.proposals div .operations-list li[class*="row"]{
    background: black;
}
.operation-indicators>li span{
    color: white;
}
#content .section-header h2{
    color:white;
}
.operation-view h2 .operation-type{
       color:white !important;
}


.operations-summary section .operations-amount.PLN .amount, .operations-summary section .available-amount.PLN .amount{
    color:white;
}

.operations-summary section .operations-amount .amount, .operations-summary section .available-amount .amount{
    color:white;
}


section.operations div .list-header, section.proposals div .list-header{
    color:white;
}

a{
    color: #cc2141;
}
#filter-nav{
       color: #cc2141;
}
.forex-grid-container .forex-grid .forex-grid-row{
    background-color: black;
    border-color:white;
}

aside section.recurrent-transfers-sum .amount{
    color: #cc2141;
}
aside section.current-period{
    color: #cc2141;
}
section.transfers .transfers-list li[class*="row"]{
    color: white;
    background-color: black;
}
section.accounts .accounts-list li[class*="row"]{
    background-color: black;
    color:white;
}
section.accounts .account-properties .product-name .value{
    color:white;
}
body.lifting #accounts-page footer span:not(.account-own-balance){
   color: #cc2141; 
}
#header #user-profile #user-profile-navigation a{
    color: white;
}
#moffers-app-view .aside-view .summary p span.amount{
    color: #cc2141; 
}
#moffers-app-view .offers-header .checkbox-label{
    color: #cc2141; 
}
#moffers-app-view .offers-header .offers-count-text{
    color: white;
}
#moffers-app-view .offers-header .offers-count{
    color: #cc2141; 
}
body.lifting #inbox-app-view section.inboxs .inbox-list .inbox-row{
    background-color: black;
    color: white;
}
section.inboxs .inbox-list .inbox-row .message-properties .message-title.not-read [class*="text"]{
    color: white;
}
.sidebar-left section.summary.all .counter {
    color: white;
}
section.applications .applications-list li[class*="row"] {
    background-color: black;
}
aside section.summary ul li:first-child .apps-count {
    color: #cc2141; 
}
#mgm-page nav ul li a{
    color: white;
}
#mgm-page markdown em{
    color: #cc2141; 
}
#mgm-page em, #mgm-page .em{
    color: #cc2141; 
}
#mgm-faq{
    color:black;
}
#main{
    background:black;
}
html.lifting {
	background:black;
}


}

